When trying to create a lodash template with the `variable` option, the expectation is that the compiled function would match [the documentation](https://lodash.com/docs#template), however it appears that the property access documented does not occur. Example:

Input SVG:
```
<svg width="12" height="12" viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg">
<path d="M4 0C1.7909 0 0 1.79086 0 4V8C0 10.2091 1.7909 12 4 12H8C10.2091 12 12 10.2091 12 8V4C12 1.79086 10.2091 0 8 0H4Z" fill="${fill}"/>
</svg>
```

Usage:
```js
const svgFile = readFileSync(file, { encoding: 'utf8' });
const compileSvg = template(svgFile, { variable: 'data' });

console.log(compileSvg.toString());
```

Output:
```
function(data) {
var __t, __p = '';
__p += '<svg width="12" height="12" viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg">\n<path d="M4 0C1.7909 0 0 1.79086 0 4V8C0 10.2091 1.7909 12 4 12H8C10.2091 12 12 10.2091 12 8V4C12 1.79086 10.2091 0 8 0H4Z" fill="' +
((__t = (fill)) == null ? '' : __t) +
'"/>\n</svg>\n';
return __p
}
```

Notice that `fill` is not being accessed from `data`, but rather as standalone. Based on the documentation, this is the output expected:

```
function(data) {
var __t, __p = '';
__p += '<svg width="12" height="12" viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg">\n<path d="M4 0C1.7909 0 0 1.79086 0 4V8C0 10.2091 1.7909 12 4 12H8C10.2091 12 12 10.2091 12 8V4C12 1.79086 10.2091 0 8 0H4Z" fill="' +
((__t = (data.fill)) == null ? '' : __t) +
'"/>\n</svg>\n';
return __p
}
```

Interestingly enough, the same lack of property access occurs even without the variable and just using the `with` statement:

```
function(obj) {
obj || (obj = {});
var __t, __p = '';
with (obj) {
__p += '<svg width="12" height="12" viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg">\n<path d="M4 0C1.7909 0 0 1.79086 0 4V8C0 10.2091 1.7909 12 4 12H8C10.2091 12 12 10.2091 12 8V4C12 1.79086 10.2091 0 8 0H4Z" fill="' +
((__t = (fill)) == null ? '' : __t) +
'"/>\n</svg>\n';

}
return __p
}
```

Is this expected? If so, it should be reflected in the documentation, but either way it isn't obvious why the lack of property access.

