My proposal is a new function `_.compare` and it's variants. It should categorize each and all elements from two collections into three arrays regarding whether the element is present in the first collection only, the second collection only or both collections. It's the combination of both differences and the intersection of the two collections, but all done in a single operation.

### Example:
```
_.compare([1, 2, 3], [2, 3, 4]);
// => [[1], [4], [2, 3]];
```

### Use case:
When updating a list of entities in a database: we have the current list state in the database (`var existing`) and the desired list state submitted by the sender (`var request`). My proposal is relevant because:

- Items in `request` but not in `existing` are new items created by the sender, and should be created in the database;
- Items in `existing` but not in `request` were deleted by the sender, and should be removed from the database;
- Items in both `request` and `existing` may have been edited by the sender, and should be updated in the database.

Therefore, all elements in both collections will result in an operation, but which operation depends on how the element was categorized.

