The `has` method does not evaluate correctly when the object has a *regular* and a *dotted* key with the same name.

```js
const errors = {
    "roles": "The roles field is required.",
    "roles.0": "The roles.0 field is required."
};

_.has(errors, 'roles'); // true
_.has(errors, 'roles.0'); // true
_.has(errors, 'roles.1'); // true
```

The last call should return `false`. When you remove the `roles` key from the object, it works fine:

```js
const errors = {
    "roles.0": "The roles.0 field is required."
};

_.has(errors, 'roles'); // false
_.has(errors, 'roles.0'); // true
_.has(errors, 'roles.1'); // false
```

Tested with [4.17.21](https://github.com/lodash/lodash/releases/tag/4.17.21).
